import React, {useState} from 'react';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import {Dialogs} from "./components/profileContentComponents/Dialogs/Dialogs";
import {ProfileContent} from "./components/profileContentComponents/Profile/ProfileContent";
import {NavBar} from "./components/Navbar/NavBar";
import {Header} from "./components/Header/Header";
import state, {PostType, RootStateType} from "./redux/state";

export interface AppProps {
    state: RootStateType;
    posts: AppStateType
}
type AppStateType = {
    posts: PostType[];
    removePost: (id: string) => void;
}



function App(props: AppProps) {

    const removePostHand = () => {

    }

    return (
            <div className="app-wrapper">
                <Header/>
                <NavBar/>
                <div className="app-wrapper-content">
                    <Routes>
                        <Route path={'PROFILE'}
                               element={<ProfileContent state={state} posts={state.profilePage && state.profilePage.posts} removePost={removePostHand}/>}/>
                        <Route path={'DIALOGS/:DIALOG?'} element={<Dialogs messagesData={state.dialogsPage.messagesData} usersData={state.dialogsPage.usersData} />}/>


                        {/*<Route path={'NEWS'} element={<News/>}/>*/}
                        {/*<Route path={'MUSIC'} element={<Music/>}/>*/}
                        {/*<Route path={'SETTINGS'} element={<Settings/>}/>*/}
                    </Routes>
                </div>
            </div>
    );

}


export default App;
